interface Head {
    <T>(list: ArrayLike<T>): T | undefined;
    (list: string): string;
}
declare const _default: Head;
/**
 * Returns the first element of the given array.
 *
 * @param {Array} arr
 * @return {*}
 * @example
 *
 *      head(['fi', 'fo', 'fum']); //=> 'fi'
 *      head([]); //=> undefined
 */
export default _default;
